    return (
      <Router>
        <ApplicationRouter />
      </Router>
    )
  }
}

function ApplicationRouter() {
  return (
    <Switch>
      {
        routes.map(item => (
          <Route
            path={item.path}
            exact
            render={() => {
              const Layout = item.layout || DefaultLayout
                (
                  <Layout>
                    {item.component}
                  </Layout>
                )
            }}
          />
        ))
      }
    </Switch>
  );
}

export default App;
